/**
 * @param {string} num1
 * @param {string} num2
 * @param {number} min_sum
 * @param {number} max_sum
 * @return {number}
 */
var count = function(num1, num2, min_sum, max_sum) {
    const MOD = 1000000007;

    function digitSum(x) {
        let sum = 0;
        while (x > 0) {
            sum += x % 10;
            x = Math.floor(x / 10);
        }
        return sum;
    }

    let start = BigInt(num1);
    let end = BigInt(num2);
    let totalCount = 0;

    for (let i = start; i <= end; i++) {
        let sum = digitSum(Number(i));
        if (sum >= min_sum && sum <= max_sum) {
            totalCount = (totalCount + 1) % MOD;
        }
    }

    return totalCount;
};
